></p> \n    <p> </p>\n    <p> </p>\n    <p><span style=\"color: #0000ff;line-height: 36.0px;font-family: 黑体;font-size: 24.0px;\">为了避免破损，江浙沪我们是一个包装发货，其他地区管子和塑料分开2张快递面单发货的。因为快递派件会有先后，亲们收到也会有先后的。偏远地区（内蒙古，海南，宁夏，西藏，青海，新疆,甘肃不包邮）！</span><span>如买家所购买餐椅在使用过程中有所损坏，我们是免费提供餐椅配件的。需要买家把坏的部位退回来然后我们把新的部位给买家发上去。期间产生的邮费寄回坏的买家出，寄新的上去卖家出。</span></p> \n    <p><span style=\"font-family: kaiti_gb2312;\"><b><font color=\"#000000\" style=\"font-size: 12.0pt;\"><span style=\"font-size: 36.0px;\"><span style=\"color: #ff0000;\"><span>矮脚餐椅是没有礼品送的。</span></span></span></font></b></span></p> \n    <p><span style=\"font-family: kaiti_gb2312;\"><b><font color=\"#000000\" style=\"font-size: 12.0pt;\"></font></b></span></p>\n    <p></p>\n    <p></p>\n    <p></p>\n    <p></p>\n    <p></p>\n    <p></p>\n    <p></p>\n   </div>\n  </div>\n </div> \n</div>', '2018-12-18 22:45:17', '2018-12-18 22:45:17');
